import { useEffect, useState, useContext } from 'react';
import Button from 'react-bootstrap/Button';
import axios from 'axios';
import { BASEURL } from './baseURL';
import { Card } from 'react-bootstrap';
import { AppContext } from './App';
import { useNavigate, Link } from 'react-router-dom';



function DoctorSlotList( {slotList, setSlotList} ) {

  const {isDoctor, setIsDoctor, doctorId} = useContext(AppContext);
  const navigate = useNavigate();
  
  useEffect(()=>{
    const callSlotList = async() =>{
      try{
        const response = await axios.get(BASEURL + `/profile/book_slots_list/${doctorId}`);
        console.log(response.data);
        setSlotList(response.data);
      }
      catch(error){
        console.error(error);
      }}
      callSlotList();
  }, [doctorId]);

  return (
    <ul className="list-unstyled">
      {slotList.map((slot) =>(
        <li key={slot.id}>
          <Card style={{ width: '18rem' }}>
          <Card.Title>{slot.patientProfile? slot.patientProfile.name : "Not Booked"}</Card.Title>
          <Card.Text>{slot.booking_date}</Card.Text>
          <Card.Text>{slot.start_time}</Card.Text>
          <Card.Text>{slot.end_time}</Card.Text>
          {slot.patientProfile &&
            <Button
            variant="primary"
            className="mb-3" 
            type="button"
            onClick={(e) => {
              e.preventDefault();
              setSelectedPatient(slot.patientProfile.id);
              navigate("/patient_detail")
              }}>
              See Details
              </Button>
            }
            {slot.patientProfile &&
              <Button
              variant="primary"
              className="mb-3" 
              type="button"
              onClick={(e) => {
                e.preventDefault();
              }}>
                Call
            </Button>
            }
            
          
          </Card>
        </li>
      ))}
    </ul>
  )
}

export default DoctorSlotList
